// SPDX-License-Identifier: MIT
pragma solidity ^0.6.2;

import "./IExerciceSolution.sol";
import "./IEvaluator.sol";
import "./ERC20TD.sol";

contract AllInOneSolution {
    ERC20TD MyERC20;
    IExerciceSolution test;
    IEvaluator evaluator;

    constructor() public{
        evaluator = IEvaluator(0x7C5629d850eCD1E640b1572bC0d4ac5210b38FA5);
    }

    function triggerExo10() external {
        evaluator.ex10_allInOne();
    }

    function completeWorkshop() external {
        evaluator.ex1_getTickerAndSupply();
        string memory ticker = evaluator.readTicker(address(this));
        uint256 supply = evaluator.readSupply(address(this));

        MyERC20 = new ERC20TD("ERC20TD", ticker, supply);

        test = IExerciceSolution(address(MyERC20));
        evaluator.submitExercice(test);

        evaluator.ex2_testErc20TickerAndSupply();


        MyERC20.addInWhitelist(address(evaluator));
        MyERC20.updateTier(address(evaluator), 1, true);
        evaluator.ex3_testGetToken();


        evaluator.ex4_testBuyToken();


        MyERC20.removeFromWhitelist(address(evaluator));
        evaluator.ex5_testDenyListing();


        MyERC20.addInWhitelist(address(evaluator));
        evaluator.ex6_testAllowListing();


        MyERC20.removeFromWhitelist(address(evaluator));
        MyERC20.updateTier(address(evaluator), 1, false);
        evaluator.ex7_testDenyListing();


        MyERC20.addInWhitelist(address(evaluator));
        MyERC20.updateTier(address(evaluator), 1, true);
        evaluator.ex8_testTier1Listing();
        

        MyERC20.updateTier(address(evaluator), 2, true);
        evaluator.ex9_testTier2Listing();
    }
}
